import * as React from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import { Box } from '@mui/material';

export default function FreeSolo({exercises}) {

  return (
    <Box sx={{ width: '70%'}}>
      <Autocomplete
        freeSolo
        id="free-solo-2-demo"
        disableClearable
        options={exercises.map((movement) => movement.map(exercise => exercise.title) )}
        renderInput={(params) => (
          <TextField
            {...params}
            label="Search Exercises"
            InputProps={{
              ...params.InputProps,
              type: 'search',
            }}
          />
        )}
      />
      </Box>
  );
}
